import './styles.css';
import { useState} from 'react';

function BoxOutput(props) {

  const results = props

  return (
        <div className='game-output'>
          <div className="ref-output">
            <span className='circle-input'></span>
            <span className='circle-input'></span>
            <span className='circle-input'></span>
            <span className='circle-input'></span>
          </div>
          <div className="box-output">
            <span className={`circle-output ${results[0]}`}></span>
            <span className={`circle-output ${results[1]}`}></span>
            <span className={`circle-output ${results[2]}`}></span>
            <span className={`circle-output ${results[3]}`}></span>
          </div>
        </div>
  );
}

export default BoxOutput;
